able_domain deoarece este gol.','Error Details: %s'=>'Detalii eroare: %s','An administrator for this blog must set up the Jetpack connection.'=>'Un administrator de pe acest blog trebuie să configureze conexiunea la Jetpack.','%s is not a valid command.'=>'%s nu este o comandă validă.','My Jetpack'=>'My Jetpack','Verification secrets not found'=>'Nu am găsit secretele verificării','Invalid user id is provided'=>'Ai furnizat un ID utilizator care nu este valid','Invalid user token is provided'=>'Ai furnizat un token invalid pentru utilizator','This request method is not supported.'=>'Această metodă de solicitare nu este acceptată.','PHP\'s XML extension is not available. Jetpack requires the XML extension to communicate with WordPress.com. Please contact your hosting provider to enable PHP\'s XML extension.'=>'Extensia XML pentru PHP nu este disponibilă. Pentru a comunica cu WordPress.com, Jetpack are nevoie de extensia XML. Te rog contactează serviciul tău de găzduire pentru a activa extensia XML pentru PHP.','The Client ID/WP.com Blog ID of this site'=>'ID client/ID blog WP.com pentru acest site','The number of sites of the connected WP.com user'=>'Numărul de site-uri ale utilizatorului WordPress.com conectat','You need to register your Jetpack before connecting it.'=>'Trebuie să te înregistrezi la Jetpack înainte de a-l conecta.','User not found.'=>'Nu am găsit utilizatorul.','https://wordpress.org/plugins/jetpack-protect'=>'https://wordpress.org/plugins/jetpack-protect','Error loading autoloader file for Jetpack Protect plugin'=>'Eroare la încărcarea fișierului încărcare automată pentru modulul Protecție Jetpack','Your installation of Jetpack Protect is incomplete. If you installed Jetpack Protect from GitHub, please refer to <a href="%1$s" target="_blank" rel="noopener noreferrer">this document</a> to set up your development environment. Jetpack Protect must have Composer dependencies installed and built via the build command.'=>'Instalarea ta Protecție Jetpack 